import React from 'react';

import { Card } from 'semantic-ui-react';

const getPlaceDetails = (e, id) => {

};

const DoctorCard = ({
  place_id,
  name,
  vicinity,
  opening_hours,
  rating,
  user_ratings_total,
  phone,
  photos,
}) => {
  return (
    <Card onClick={e => getPlaceDetails(e, place_id)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
      <Card.Content>
        {vicinity}

        <Card.Meta>{phone}</Card.Meta>
        <span>{rating}</span>
      </Card.Content>
    </Card>
  );
};

export default DoctorCard;
